import './App.css';
import {scroll, banner1, banner2, banner3} from './assets/export'

function App() {
  return (
    <>
      <div>
        <div>
          <img src={banner1} alt="banner" />
        </div>
        <div>
          <img src={banner1} alt="banner2" />
        </div>
        <div>
          <img src={banner1} alt="banner3" />
        </div>
      </div>

    </>
  );
}

export default App;
